import React from 'react';

const PlayButton = ({ token }) => {
  console.log('lets play!');
}

const Home = () => {
    return (
        <div>
        { !token? 
            <p>
               Sign in/Create an account to get started!
            </p> 
            :
            <button 
              className='button' 
              onClick={PlayButton}
            >
              Play
            </button>
        }
        </div>
    )
  }

export default Home;
